import { Route,Routes,ink } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="App">
     <nav>
      <Link to="/">hi</Link>
     </nav>
     <Routes>
      <Route path='/' element={<App/>}/>
     </Routes>
    </div>
  );
}

export default App;
